   const {x: gx, y: gy} = cb_data.geometry; // Hover coords (ms epoch, linear index)\n        const div = hover_div; // The Div model passed in args\n        const bar_source_js = bar_source;       // Bar chart source\n        const bar_x_range_js = bar_x_range;     // Bar chart x-range (FactorRange)\n\n        // Data arrays from Python\n        const times = times_array;\n        const freqs = freqs_array; // Actual frequency numbers\n        const freq_labels_str = freq_labels_array; // Frequency strings for labels\n        const levels_flat = levels_flat_array; // FLATTENED levels matrix (original data w/ NaN)\n\n        const n_times = times.length;\n        const n_freqs = freqs.length;\n        const x_start = fig_x_range.start;\n        const x_end = fig_x_range.end;\n\n        // Bar chart data object\n        const bar_data = bar_source_js.data;\n\n        // Check if hover is within the main plot area (image bounds)\n        const is_inside = !(gx &lt; x_start || gx &gt; x_end || gy &lt; -0.5 || gy &gt; n_freqs - 0.5 || n_times === 0 || n_freqs === 0);\n\n        if (is_inside) {\n            // --- Calculate Indices ---\n            let time_idx = -1;\n            let min_time_diff = Infinity;\n            // Find closest time_idx (use binary search if n_times is large and sorted)\n             for (let i = 0; i &lt; n_times; i++) {\n                const diff = Math.abs(times[i] - gx);\n                if (diff &lt; min_time_diff) {\n                    min_time_diff = diff;\n                    time_idx = i;\n                } else if (diff &gt; min_time_diff &amp;&amp; i &gt; 0) {\n                    break; // Since times are sorted, diff will only increase\n                }\n            }\n            if (time_idx === -1) time_idx = 0; // Fallback\n\n            const freq_idx = Math.max(0, Math.min(n_freqs - 1, Math.floor(gy + 0.5)));\n\n            // --- Lookup Data for Div ---\n            const time_val_ms = times[time_idx];\n            const freq_val = freqs[freq_idx];\n            const flat_index_hover = time_idx * n_freqs + freq_idx;\n            const level_val_hover = levels_flat[flat_index_hover];\n\n            // --- Format for Div ---\n            const time_str = new Date(time_val_ms).toLocaleString();\n            const freq_str = freq_labels_str[freq_idx]; // Use pre-formatted label\n            let level_str_hover = \"\";\n            if (level_val_hover === null || level_val_hover === undefined || Number.isNaN(level_val_hover)) {\n                 level_str_hover = \"N/A\";\n            } else {\n                 level_str_hover = level_val_hover.toFixed(1) + \" dB\";\n            }\n            div.text = `&lt;b&gt;Time:&lt;/b&gt; ${time_str} | &lt;b&gt;Freq:&lt;/b&gt; ${freq_str} | &lt;b&gt;Level:&lt;/b&gt; ${level_str_hover}`;\n\n\n            // --- Update Bar Chart ---\n            const start_index_slice = time_idx * n_freqs;\n            const end_index_slice = start_index_slice + n_freqs;\n            let levels_slice = levels_flat.slice(start_index_slice, end_index_slice); // Get the slice\n\n            // Optional: Map NaN to 0 or another value for bar display\n            levels_slice = levels_slice.map(level =&gt; (level === null || level === undefined || Number.isNaN(level)) ? 0 : level);\n\n            // Update bar chart source data\n            bar_data['levels'] = levels_slice;\n            bar_data['frequency_labels'] = freq_labels_str; // Use the string labels\n\n            // Update bar chart x-axis factors (**CRUCIAL**)\n            bar_x_range_js.factors = freq_labels_str;\n\n            // Emit change to update the bar chart plot\n            bar_source_js.change.emit();\n\n        } else {\n            // --- Clear Div and Bar Chart when hover is outside ---\n            div.text = \"Hover over spectrogram for details\"; // Reset Div text\n\n            // Clear bar chart data\n            bar_data['levels'] = [];\n            bar_data['frequency_labels'] = [];\n            bar_x_range_js.factors = []; // Clear factors\n\n            // Emit change to update the bar chart plot\n            bar_source_js.change.emit();\n        }\n    "}},"tooltips":null}}],"active_drag":{"id":"p1093"},"active_scroll":{"id":"p1095"}}},"left":[{"type":"object","name":"LinearAxis","id":"p1086","attributes":{"ticker":{"type":"object","name":"FixedTicker","id":"p1122","attributes":{"ticks":{"type":"ndarray","array":{"type":"bytes","data":"AAAAAAEAAAACAAAAAwAAAAQAAAAFAAAABgAAAAcAAAAIAAAACQAAAAoAAAALAAAADAAAAA0AAAAOAAAADwAAABAAAAARAAAAEgAAABMAAAA="},"shape":[20],"dtype":"int32","order":"little"},"minor_ticks":[]}},"formatter":{"type":"object","name":"BasicTickFormatter","id":"p1088"},"axis_label":"Frequency (Hz)","axis_label_text_font_size":"9pt","major_label_overrides":{"type":"map","entries":[[0,"25"],[1,"31"],[2,"40"],[3,"50"],[4,"63"],[5,"80"],[6,"100"],[7,"125"],[8,"160"],[9,"200"],[10,"250"],[11,"315"],[12,"400"],[13,"500"],[14,"630"],[15,"800"],[16,"1000"],[17,"1250"],[18,"1600"],[19,"2000"]]},"major_label_policy":{"type":"object","name":"AllLabels","id":"p1089"},"major_label_text_font_size":"9pt"}}],"right":[{"type":"object","name":"ColorBar","id":"p1123","attributes":{"title":"LZeq (dB)","title_text_font_size":"9pt","major_label_policy":{"type":"object","name":"NoOverlap","id":"p1124"},"major_label_text_font_size":"9pt","color_mapper":{"id":"p1054"}}}],"below":[{"type":"object","name":"DatetimeAxis","id":"p1069","attributes":{"ticker":{"type":"object","name":"DatetimeTicker","id":"p1109","attributes":{"desired_num_ticks":10,"tickers":[{"type":"object","name":"AdaptiveTicker","id":"p1110","attributes":{"num_minor_ticks":0,"mantissas":[1,2,5],"max_interval":500.0}},{"type":"object","name":"AdaptiveTicker","id":"p1111","attributes":{"num_minor_ticks":0,"base":60,"mantissas":[1,2,5,10,15,20,30],"min_interval":1000.0,"max_interval":1800000.0}},{"type":"object","name":"AdaptiveTicker","id":"p1112","attributes":{"num_minor_ticks":0,"base":24,"ma
